  messagingSenderId: "89950348574"
});

var db = firebase.firestore();

class App extends Component {
  constructor() {
    super();
    this.state = {
      speed: 10
    };
  }

  componentDidMount() {

  }

  render() {
    return (
      <div className="App">
      <h1>{this.state.speed}</h1>
        <Header userData={this.state.fakedata} />
        <BodyContainer userData={this.state.fakedata} />
      </div>
    );
  }
}

export default App;
